import { useEffect, useState, useRef, useContext } from 'react';
import { useParams } from 'react-router-dom';
import { Context } from "../../SharedState"

function IndividualPage({vehiculo}) {


    //Variable para coger datos de la URL
    const parms = useParams();
    console.log(parms.id);
    
    let numeroString=parms.id;
    let numero=parseInt(numeroString,10);



    return (
        <>
            <h2>Marca: {vehiculo[numero].marca}</h2>
            <h2>Modelo: {vehiculo[numero].modelo}</h2>
            <h2>Precio: {vehiculo[numero].precio}</h2>
            <img src={vehiculo[numero].img}/>
        </>

    );
}

export default IndividualPage;
